import '../compontent-styles/sideNavTab.css';

function SideNavTab()
{
    return(
        <div id="side-nav-tab">
            <nav>
                <ul>
                    <li><h3>Connect Wallet</h3></li>
                    <li><h3>Vote</h3></li>
                    <li><h3>Results</h3></li>
                    <li><h3>Log-out</h3></li>
                </ul>
            </nav>
        </div>
    );
}

export default SideNavTab
